import React from "react";
import { Link } from "react-router-dom";
import { useState,} from "react";
import axios from "axios";

function Create() {
const [values,setValues] = useState({
name:'',
email:'',
phone:''
})

    const userSubmit=(e)=>{
        alert("hiii");
        e.preventDefault();
axios.post('http://localhost:3000/users', values).then((res)=>{
    console.log(res);
}).catch((err)=>{
    console.log(err);
});
    }
  return (
    <React.Fragment>
       <div className="container">
        <div className="row shadow p-3 mb-5 bg-white rounded d-flex flex-coloumn align-items-center justify-content-center mt-5 vh-50">
            <div className="col-md-6">
            <h2 className="fw-bold">Add a user</h2>
    <form onSubmit={userSubmit}>
    <div className="form-group">
      <label>Name:</label>
      <input type="text" className="form-control mb-3" placeholder="Enter Name"
      onChange={e => setValues({...values, name:e.target.value})}/>
    </div>
    <div className="form-group">
      <label>Email:</label>
      <input type="text" className="form-control mb-3" placeholder="Enter Email"
      onChange={e => setValues({...values, email:e.target.value})}/>
    </div>
    <div className="form-group">
      <label>Phone:</label>
      <input type="text" className="form-control mb-3" placeholder="Enter Phone"
      onChange={e => setValues({...values, phone:e.target.value})}/>
    </div>
    <button type="submit" className="btn btn-primary rounded me-3">Submit</button>
    <Link to='/' className="btn btn-success rounded">Back</Link> 

    </form>

   </div>
            </div>
        </div>

    </React.Fragment>

  )
}

export default Create;
